THE ALEX JONES SHOW 
2010.03.02 Tuesday

Alex talks with Brad Martin, a local business owner in Cornelius, Oregon. Martin was raided by ATF agents in October for the crime of selling Airsoft BB guns from his store. The merchandise is valued at $12,000 and the ATF has vowed to destroy it as a threat to the public. Former mid-level CIA officer in the 1960s who prepared daily security briefs for Reagan and George H.W. Bush, Ray McGovern, also talks with Alex. Mike Rivero, webmaster of the popular alternative news portal WRH and GCN talk show host, makes his monthly appearance.

HOUR 1: Jobless rate continue to rise, crude oil price rises, gold prices at
new 6 week high (manipulated market), census taking violation of Constitution,
over 21% reduction in medicare payments, economy - hows globalism working out?
RAY MCGOVERN on barry soetoro obama - Israel - Middle East, etc.

HOUR 2: Ray McGovern, MIKE RIVERO, pending war Israel/Iran?, political
calculations, Gnashing of teeth - wars and rumors of wars, America waking
up, don't trust government with your personal data - right to privacy 4th
amendment, obama re-authorizes the worste parts of bush administration's 
Patriot Act, etc.

HOUR 3: Open Lines with Mike Rivero, news &amp; commentary, Ted Anderson, 
BRAD MARTIN, BATFE grabbing toy guns, it is a disarmament agenda

